INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("ヤマト", 130011, "2030/01/01 14:59:59", -416.5, 2.1, 100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "2024/10/31 12:00:00", 2, 3001, 1, 0.0, 3001100);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("ヤマト", 130011, "2030/01/01 14:59:59", -416.5, 5.68, 101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "2024/10/31 12:00:00", 2, 3001, 4, 0.0, 3001101);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("ヤマト", 130011, "2030/01/01 14:59:59", -416.5, 0.0, 102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "2024/10/31 12:00:00", 1, 3001, 1, 0.0, 3001102);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 130211, "2030/01/01 14:59:59", -416.5, 0.0, 100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "2024/10/31 12:00:00", 1, 3002, 1, 0.0, 3002100);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 130211, "2030/01/01 14:59:59", -416.5, 0.0, 101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "2024/10/31 12:00:00", 1, 3002, 1, 0.0, 3002101);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 130211, "2030/01/01 14:59:59", -416.5, 8.53, 102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "2024/10/31 12:00:00", 2, 3002, 5, 0.0, 3002102);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 130211, "2030/01/01 14:59:59", -416.5, 5.67, 103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "2024/10/31 12:00:00", 1, 3002, 7, 0.0, 3002103);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 130211, "2030/01/01 14:59:59", -416.5, 0.0, 104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "2024/10/31 12:00:00", 1, 3002, 1, 0.0, 3002104);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 130211, "2030/01/01 14:59:59", -416.5, 0.0, 300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "2024/10/31 12:00:00", 3, 3004, 3, 0.0, 3002300);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 130211, "2030/01/01 14:59:59", -416.5, 0.0, 301, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "2024/10/31 12:00:00", 7, 3005, 7, 0.0, 3002400);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 130211, "2030/01/01 14:59:59", -416.5, 4.4, 200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "2024/10/31 12:00:00", 1, 3003, 2, 0.0, 3003200);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 130211, "2030/01/01 14:59:59", -416.5, 0.0, 201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "2024/10/31 12:00:00", 7, 3003, 7, 0.0, 3003201);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES ("フブキ", 130211, "2030/01/01 14:59:59", -416.5, 5.6, 202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "2024/10/31 12:00:00", 2, 3003, 1, 0.0, 3003202);
